import React from 'react';

import styles from './BudsSummary.module.css';

const BudsSummary = () => {
  return (
    <section className={styles.summary}>
      <h2>Medical Grade Buds, treats and tools deliverd to your you!</h2>
      <p>
        Enjoy a simple,but diverse collection of flowers that vary from indica
        to sativa.
      </p>

      <p>
        Starting Now, we are shipping to you for FREE! Speak with a
        representative today!
      </p>
    </section>
  );
};

export default BudsSummary;
